const selected = new Set();
const counter = document.getElementById('counter');

function updateCounter() {
  const count = selected.size;
  counter.textContent = `${count} dÃ©partement${count > 1 ? 's' : ''} dans lesquels j'ai dormi`;
}

map.on('load', () => {
  map.addSource('zones', { type: 'geojson', data: polygons });

  map.addLayer({
    id: 'zones-fill',
    type: 'fill',
    source: 'zones',
    paint: {
      'fill-color': [
        'case',
        ['in', ['get', 'NOM_M'], ['literal', Array.from(selected)]],
        '#f00',
        '#00aaff'
      ],
      'fill-opacity': 0.5
    }
  });

  map.addLayer({
    id: 'zones-outline',
    type: 'line',
    source: 'zones',
    paint: { 'line-color': '#000', 'line-width': 0.7 }
  });

  // ---- POPUP / HOVER ROBUSTE ----
  // rÃ©utiliser le mÃªme popup pour Ã©viter "flicker"
  const popup = new maplibregl.Popup({
    closeButton: false,
    closeOnClick: false,
    className: 'my-tooltip' // permet de styler si besoin
  });

  // mousemove sur la couche â€” toujours vÃ©rifier e.features
  map.on('mousemove', 'zones-fill', (e) => {
    if (!e || !e.features || !e.features.length) {
      popup.remove();
      return;
    }

    const feature = e.features[0];
    // fallback si NOM_DEP indisponible
    const nomDep = feature.properties && (feature.properties.NOM_M || feature.properties.NOM_M || 'Nom inconnu');

    // debug console (supprime si ok)
    // console.log('hover feature props:', feature.properties);

    // positionner et afficher le popup
    popup
      .setLngLat(e.lngLat)
      .setHTML(`<strong>${nomDep}</strong>`)
      .addTo(map);
  });

  // Quand on quitte la couche -> retirer la popup
  map.on('mouseleave', 'zones-fill', () => {
    popup.remove();
  });

  // Clic sÃ©lection / dÃ©sÃ©lection
  map.on('click', 'zones-fill', (e) => {
    if (!e || !e.features || !e.features.length) return;
    const nom = e.features[0].properties.NOM_M;
    if (!nom) return;

    if (selected.has(nom)) selected.delete(nom);
    else selected.add(nom);

    map.setPaintProperty('zones-fill', 'fill-color', [
      'case',
      ['in', ['get', 'NOM_M'], ['literal', Array.from(selected)]],
      '#f00',
      '#00aaff'
    ]);
    updateCounter();
  });

  // curseur pointeur
  map.on('mouseenter', 'zones-fill', () => map.getCanvas().style.cursor = 'pointer');
  map.on('mouseleave', 'zones-fill', () => map.getCanvas().style.cursor = '');
